package PatternsPractise;

public class PatternProgram17 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		char i;
		char j;
		for (i='A';i<='E';i++) {
			for(j='A';j<='E';j++) {
				//System.out.print(i);
				System.out.print(j);
			}
				System.out.println();
		}

	}

}
